import React from "react";
import Category from "../child/Category";
import cartImg from "../../images/typing.png";

const Books = () =>{
    return(
        <>
            <div class="container">
                <div class="row">
                    <div class="col-md-3">
                        <Category data="Books"/>
                    </div>
                    <div class="col-md-9">
                        <section className="my-g-section">
                       
                        </section>
                    </div>
                </div>
            </div>
        </>
    );
}
export default Books;
